    [],nt"revision_timestamp": "2015-01-22T15:57:38.538995",nt"name": "hecm-single-family-portfolio-snapshot",nt"isopen":
    false,nt"url": null,nt"notes": "The Federal Housing Administration's HECM
    program is the only government-insured reverse mortgage program. The HECM program
    guarantees that the lender will meet its payment obligations to the homeowner, limits
    the borrower's loan origination costs, and insures full repayment of the loan balance
    to the lender up to the maximum claim amount. The loan amount is based on borrower
    age, home value, and current interest rates. The HECM data files provide loan-level
    records that will enable interested parties to explore issues regarding downpayment
    assistance provided to homebuyers utilizing HECM insured mortgage financing.",nt"license_title":
